(1, 1, 1, 'Rôle et responsabilités du constructeur et de l’employeur', 'https://www.youtube.com/watch?v=mhqwyCZNiOY', 'Titre 1', 'Sur les Ipad, on m\'a précisé que les ipads pas pro fonctionnaient aussi avec le stylet maintenant. \r\nQuand je dis que ce n\'est pas pensé pour un usage pro, je ne veux pas dire que les pros ne l\'utilisent pas, je veux dire que utilisé seul, sans ordi, ça me paraît pas ultra praticable pour tout faire. \r\nNéanmoins, j\'ai eu pas mal de commentaires de personnes qui n\'utilisaient finalement que leurs Ipad, donc ça dépend énormément des profils, et j\'ai peut être un avis trop tranché dans la vidéo. Si vous envisagez cette solution, il y a des comparatifs Wacom/Ipad sur youtube qui pourront vous aider.\r\n(Et en tout cas, pour moi, je suis sûre que je serai trop limitée avec un Ipad, notamment parce que je fais de la vidéo, de l\'anim, de la mise en page, et que je suis habituée à la suite Adobe)', 'Titre 2', 'Sur les Ipad, on m\'a précisé que les ipads pas pro fonctionnaient aussi avec le stylet maintenant. \r\nQuand je dis que ce n\'est pas pensé pour un usage pro, je ne veux pas dire que les pros ne l\'utilisent pas, je veux dire que utilisé seul, sans ordi, ça me paraît pas ultra praticable pour tout faire. \r\nNéanmoins, j\'ai eu pas mal de commentaires de personnes qui n\'utilisaient finalement que leurs Ipad, donc ça dépend énormément des profils, et j\'ai peut être un avis trop tranché dans la vidéo. Si vous envisagez cette solution, il y a des comparatifs Wacom/Ipad sur youtube qui pourront vous aider.\r\n(Et en tout cas, pour moi, je suis sûre que je serai trop limitée avec un Ipad, notamment parce que je fais de la vidéo, de l\'anim, de la mise en page, et que je suis habituée à la suite Adobe)', NULL, NULL, 1),
